import React, { Component } from "react";
import "./components.css";
import Typing from "react-typing-animation";
import Avatar from "@material-ui/core/Avatar";
import { makeStyles } from "@material-ui/core/styles";
import Tooltip from "@material-ui/core/Tooltip";
import Button from "@material-ui/core/Button";
// import Icon from "@material-ui/core/Icon";
import Typography from "@material-ui/core/Typography";

import { Icon } from "antd";

export default class About extends Component {
  render() {
    return (
      <div className="home" id="home">
        <img src={require("../images/me.jpg")} className="me" />
        <img src={require("../images/uva.jpg")} className="uva" />
        <Typing className="centered" speed={9} hideCursor={false}>
          <Typography>
            <div className="name">SUNG JOON PARK</div>
          </Typography>
          <Typography>
            <div className="name2">STUDENT & SOFTWARE DEVELOPER</div>

            <Typing.Delay ms={500} />
          </Typography>
        </Typing>

        {/* <Tooltip disableFocusListener disableTouchListener title="Add">
          <Button>Hover</Button>
        </Tooltip> */}
        <div className="icons">
          <Icon type="phone" theme="outlined" style={{ fontSize: 30 }} />
          <Icon type="mail" theme="outlined" style={{ fontSize: 30 }} />
          <Icon type="linkedin" theme="outlined" style={{ fontSize: 30 }} />
          <Icon type="github" theme="outlined" style={{ fontSize: 30 }} />
        </div>
      </div>
    );
  }
}
